import React from 'react'
import { Link } from 'react-router-dom'
import {Heading} from 'grommet'

function Navbar () {

    return(
      <div>
        <Heading margin="none" size="xsmall"><Link style={{ textDecoration: 'none', color: 'white' }} to="/">Home</Link></Heading>
        <Heading margin="none" size="xsmall"><Link style={{ textDecoration: 'none', color: 'white' }} to="/books">Books</Link></Heading>
      </div>
    )
}

export default Navbar;
